class OpcaoJogadaSeguida {
    tipo;
    dados;
    total;
    controle;

    constructor() {
        this.tipo = "seguida";
        this.dados = [];
        this.total = 0;
        this.controle = 0;
    }

    getTipo() {
        return this.tipo;
    }

    setDados(dados) {
        this.dados = dados;
    }
    getDados() {
        return this.dados;
    }

    setTotal(total) {
        this.total = total;
    }
    getTotal() {
        return this.total;
    }

    setControle(controle) {
        this.controle = controle;
    }
    getControle() {
        return this.controle;
    }

    filtro(array) {
        let aux = null;
        for(let i=0; i<array.lenght; i++) {
            for(let j=0; j<array.lenght-1; j++) {
                if(array[j] > array[j+1]) {
                    aux = array[j];
                    array[j] = array[j+1];
                    array[j+1] = aux;
                }
            }   
        }
        this.dados = array;
        this.total = 1;
        this.controle++;
        return array;
    }
}

export default OpcaoJogadaSeguida;
